import React from 'react';
import logo from './images/logo.png';
import './App.css';

function App() {
  return (
    <div>
      <header>
        <nav className="pc-nav">
          <h1>
            <a href="/">RICO NOTES</a>
          </h1>
          <ul>
            <li><a href="home">Portfolio</a></li>
            <li><a href="blog">About</a></li>
          </ul>
        </nav>
      </header>
      <div className="header">
        <img src={logo} className="App-logo" alt="logo"/>
      </div>
    </div>
  );
}

export default App;
